import courseModel from "../data";

export default function CourseCard(){

    const course = courseModel.map(({id, name, description, duration, thumbnail}) => {
        return(
            <div style={{border: "1px solid black"}}>
            <h1>{name}</h1>
            <img alt="course"/>
            <p>{description}</p>
            <div>
                <p>Intermediate</p>
                <p>{duration}</p>
            </div>
        </div>
        );
    })
    return(
        <div style={{border: "1px solid black"}}>
            <h1>Learn React</h1>
            <img alt="react course"/>
            <p>Learn React.JS from scratch building projects</p>
            <div>
                <p>Intermediate</p>
                <p>8 weeks</p>
            </div>
        </div>
    );
};
